<!DOCTYPE html>
<html>
    <head>
        <title>CAH AT Report</title>
        <meta charset="utf-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <!-- Import style -->
        <link rel="stylesheet" href="https://unpkg.com/vuetify@3.4.11/dist/vuetify.min.css" />
        <link rel="stylesheet" href="https://unpkg.com/@mdi/font@7.3.67/css/materialdesignicons.min.css" />

        <!-- Import Vue3 and vuetify -->
        <script src="https://unpkg.com/vue@3.3.6/dist/vue.global.js"></script>
        <script src="https://unpkg.com/vuetify@3.4.11/dist/vuetify.min.js"></script>
        
        <!-- Import apexcharts.js -->
        <script src="https://unpkg.com/apexcharts@3.44.0/dist/apexcharts.js"></script>

        <!-- Use other JS CDN if need -->
        <!-- 
            [https://unpkg.com/]  [https://unpkg.dev/] [https://cdn.cbd.int/] [https://cdn.jsdelivr.net/npm/]
            https://unpkg.com/vuetify@3.4.11/dist/vuetify.min.css
            https://unpkg.com/@mdi/font@7.3.67/css/materialdesignicons.min.css
            https://unpkg.com/vue@3.3.6/dist/vue.global.js
            https://unpkg.com/vuetify@3.4.11/dist/vuetify.min.js
            https://unpkg.com/apexcharts@3.44.0/dist/apexcharts.js

            [https://cdn.staticfile.net/]
            https://cdn.staticfile.net/vuetify/3.4.11/vuetify.min.css
            https://cdn.staticfile.net/vuetify/3.4.11/vuetify.min.js
            https://cdn.staticfile.net/vue/3.3.6/vue.global.js
            https://cdn.staticfile.net/apexcharts/3.44.0/apexcharts.js
         -->
        <!-- Import vuetify Lab components if need -->
        <!-- 
            <link rel="stylesheet" href="https://unpkg.com/vuetify@3.4.11/dist/vuetify-labs.min.css" />
            <script src="https://unpkg.com/vuetify@3.4.11/dist/vuetify-labs.js"></script>
         -->
    </head>

    <body>

        <div id="app-view">
            <v-app>
                <v-app-bar elevation="5" color="primary" image="https://cdn.vuetifyjs.com/images/backgrounds/bg-2.jpg">

                    <v-app-bar-nav-icon icon="$menu" :active="mainMenuState"
                        @click.stop="mainMenuOnClick"></v-app-bar-nav-icon>
                    <v-app-bar-title>{{ projectName }} Automaton Test Report</v-app-bar-title>
                    <v-btn size="x-large" :icon="reportStatusIcons[reportStatusIconIndex]"></v-btn>
                    <v-btn size="x-large" variant="text" icon="mdi-dots-vertical"></v-btn>
                </v-app-bar>

                <v-navigation-drawer elevation="5" width="180" color="primary" :rail="!mainMenuState"
                    image="https://cdn.vuetifyjs.com/images/backgrounds/bg-2.jpg" v-model="navDrawerState">
                    <v-list lines="two" :items="mainMenuItems" v-model:selected="selectedMenuItems"
                        @click="mainMenuItemOnClick"></v-list>
                </v-navigation-drawer>

                <v-main style="background-color: whitesmoke">
                    <v-container fluid v-show="mainMenuItems[0].props.active">
                        <!-- class="d-flex flex-row flex-wrap align-center justify-center" -->
                        <v-row justify="center">
                            <v-col cols="auto">
                                <v-card subtitle="MODULE" :elevation="vcardStyle.elevation" :color="vcardStyle.color"
                                    :density="vcardStyle.density">
                                    <v-card-item :title="module"></v-card-item>
                                </v-card>
                            </v-col>
                            <v-col cols="auto">
                                <v-card subtitle="SUITE" :elevation="vcardStyle.elevation" :color="vcardStyle.color"
                                    :density="vcardStyle.density">
                                    <v-card-item :title="suite"></v-card-item>
                                </v-card>
                            </v-col>
                            <v-col cols="auto">
                                <v-card subtitle="ENVIRONMENT" :elevation="vcardStyle.elevation"
                                    :color="vcardStyle.color" :density="vcardStyle.density">
                                    <v-card-item :title="environment"></v-card-item>
                                </v-card>
                            </v-col>
                            <v-col cols="auto">
                                <v-card subtitle="EXECUTION DATE" :elevation="vcardStyle.elevation"
                                    :color="vcardStyle.color" :density="vcardStyle.density">
                                    <v-card-item :title="date"></v-card-item>
                                </v-card>
                            </v-col>
                            <v-col cols="auto">
                                <v-card subtitle="EXECUTION TIME(Sec)" :elevation="vcardStyle.elevation"
                                    :color="vcardStyle.color" :density="vcardStyle.density">
                                    <v-card-item :title="totalDuration"></v-card-item>
                                </v-card>
                            </v-col>
                        </v-row>
                        <v-row><v-divider :thickness="vdivider.thickness" :color="vdivider.color"></v-divider></v-row>
                        <v-row>
                            <v-tabs align-tabs="center" grow bg-color="" v-model="dashboardTab">
                                <v-tab value="func">Function Results</v-tab>
                                <v-tab value="webapi">Web API Performance</v-tab>
                                <v-tab value="webui">Web UI Performance</v-tab>
                            </v-tabs>
                        </v-row>
                        <v-row><v-divider thickness="0" :color="vdivider.color"></v-divider></v-row>
                        <v-row>
                            <v-window v-model="dashboardTab">
                                <v-window-item value="func" @group:selected="funcTabSelected">
                                    <v-card>
                                        <v-row justify="start" no-gutters>
                                            <v-col cols="auto">
                                                <v-card subtitle="TOTAL CASES" :elevation="vcardStyle.elevation"
                                                    color="info" :density="vcardStyle.density">
                                                    <v-card-item :title="totalCases"></v-card-item>
                                                </v-card>
                                                <v-card subtitle="PASSED CASES" :elevation="vcardStyle.elevation"
                                                    color="info" :density="vcardStyle.density">
                                                    <v-card-item :title="passedCases"></v-card-item>
                                                </v-card>
                                                <v-card subtitle="FAILED CASES" :elevation="vcardStyle.elevation"
                                                    color="info" :density="vcardStyle.density">
                                                    <v-card-item :title="failedCases"></v-card-item>
                                                </v-card>
                                                <v-card subtitle="SKIPPED CASES" :elevation="vcardStyle.elevation"
                                                    color="info" :density="vcardStyle.density">
                                                    <v-card-item :title="skippedCases"></v-card-item>
                                                </v-card>
                                                <v-card subtitle="PASSED RATE" :elevation="vcardStyle.elevation"
                                                    color="info" :density="vcardStyle.density">
                                                    <v-card-item :title="passedRate"></v-card-item>
                                                </v-card>
                                            </v-col>
                                            <v-card-item>
                                                <div id="funcTestResultChart"></div>
                                            </v-card-item>
                                            <v-card-item>
                                                <div id="funcTestTimeConsumingChart"></div>
                                            </v-card-item>
                                        </v-row>
                                    </v-card>
                                </v-window-item>

                                <v-window-item value="webapi" @group:selected="webapiTabSelected">
                                    <v-card>
                                        <v-row justify="start" no-gutters>
                                            <v-col cols="auto">
                                                <v-card subtitle="HTTP METHOD" :elevation="vcardStyle.elevation"
                                                    color="info" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card subtitle="TOTAL" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card subtitle="GET" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card subtitle="POST" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card subtitle="PUT" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card subtitle="DELETE" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card subtitle="OTHERS" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="REQUEST COUNT" :elevation="vcardStyle.elevation"
                                                    color="info" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.totalCount" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.getCount" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.postCount" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.putCount" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.deleteCount" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.othersCount" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="AVERAGE RESPONSE TIME(Sec)"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.averageResTimeOfTotal" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.averageResTimeOfGet" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.averageResTimeOfPost" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.averageResTimeOfPut" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.averageResTimeOfDelete" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.averageResTimeOfOthers" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="ERROR RATE"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.errRateOfTotal" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.errRateOfGet" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.errRateOfPost" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.errRateOfPut" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.errRateOfDelete" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card :subtitle="webapiPerfSummary.errRateOfOthers" :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                            <v-card-item>
                                                <div id="webapiPerfResultChart"></div>
                                            </v-card-item>
                                        </v-row>
                                        <v-row justify="start" no-gutters>
                                            <v-card-item>
                                                <div id="webapiPerfTimeChart"></div>
                                            </v-card-item>
                                        </v-row>
                                    </v-card>
                                </v-window-item>

                                <v-window-item value="webui" @group:selected="webuiTabSelected">
                                    <v-card>
                                        <v-row justify="start" no-gutters>
                                            <v-col cols="auto">
                                                <v-card subtitle="NAVIGATION(Pages)" :elevation="vcardStyle.elevation" width="780" 
                                                    color="light-blue-darken-2" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card v-for="(nav, index) in webuiPerfSummary.navigations" width="780" 
                                                    :subtitle="nav.url"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                    <v-tooltip activator="parent" location="top" :text="nav.url"></v-tooltip>
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="COUNT" :elevation="vcardStyle.elevation"
                                                    color="light-blue-darken-2" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card v-for="(nav, index) in webuiPerfSummary.navigations"
                                                    :subtitle="nav.count"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="AVERAGE TIME(Sec)" :elevation="vcardStyle.elevation"
                                                    color="light-blue-darken-2" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card v-for="(nav, index) in webuiPerfSummary.navigations"
                                                    :subtitle="nav.averageTime"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="MAX TIME(Sec)" :elevation="vcardStyle.elevation"
                                                    color="light-blue-darken-2" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card v-for="(nav, index) in webuiPerfSummary.navigations"
                                                    :subtitle="nav.maxTime"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="MIN TIME(Sec)" :elevation="vcardStyle.elevation"
                                                    color="light-blue-darken-2" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card v-for="(nav, index) in webuiPerfSummary.navigations"
                                                    :subtitle="nav.minTime"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                        </v-row>

                                        <v-row justify="start" no-gutters>
                                            <v-col cols="auto">
                                                <v-card subtitle="AJAX(Top 10 Time Consuming Resources)" width="780" 
                                                    :elevation="vcardStyle.elevation" color="light-blue-darken-2"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                                <v-card v-for="(res, index) in webuiPerfSummary.resources" width="780"
                                                    :subtitle="res.url"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                    <v-tooltip activator="parent" location="top" :text="res.url"></v-tooltip>
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="COUNT" :elevation="vcardStyle.elevation"
                                                    color="light-blue-darken-2" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card v-for="(res, index) in webuiPerfSummary.resources"
                                                    :subtitle="res.count"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="AVERAGE TIME(Sec)" :elevation="vcardStyle.elevation"
                                                    color="light-blue-darken-2" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card v-for="(res, index) in webuiPerfSummary.resources"
                                                    :subtitle="res.averageTime"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="MAX TIME(Sec)" :elevation="vcardStyle.elevation"
                                                    color="light-blue-darken-2" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card v-for="(res, index) in webuiPerfSummary.resources"
                                                    :subtitle="res.maxTime"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                            <v-col cols="auto">
                                                <v-card subtitle="MIN TIME(Sec)" :elevation="vcardStyle.elevation"
                                                    color="light-blue-darken-2" :density="vcardStyle.density">
                                                </v-card>
                                                <v-card v-for="(res, index) in webuiPerfSummary.resources"
                                                    :subtitle="res.minTime"
                                                    :elevation="vcardStyle.elevation" color="info"
                                                    :density="vcardStyle.density">
                                                </v-card>
                                            </v-col>
                                        </v-row>
                                        
                                        <v-row justify="start">
                                            <v-card-item>
                                                <div id="webuiNavPerfOverviewChart"></div>
                                            </v-card-item>
                                            <v-card-item>
                                                <div id="webuiTop10AjaxPerfChart"></div>
                                            </v-card-item>
                                        </v-row>
                                    </v-card>
                                </v-window-item>
                            </v-window>
                        </v-row>
                    </v-container>

                    <v-container fluid v-show="mainMenuItems[1].props.active">
                        <v-card title="Function Result Details">
                            <v-card-item>
                                <v-text-field v-model="funcResultsDetailTable.search" append-icon="mdi-magnify"
                                    label="Search" single-line clearable hide-details></v-text-field>
                            </v-card-item>
                            <v-card-item style="font-size: 14px; font-family: Calibri;"> <!-- Sans-Serif Calibri -->
                                <v-data-table items-per-page-text="" density="compact"
                                    v-model:items-per-page="funcResultsDetailTable.itemsPerPage"
                                    :show-current-page="funcResultsDetailTable.showCurrentPage"
                                    :headers="funcResultsDetailTable.headers" 
                                    :items="funcResultsDetailTable.body"
                                    :multi-sort="funcResultsDetailTable.multiSort"
                                    :sticky="funcResultsDetailTable.stickyHeader"
                                    :search="funcResultsDetailTable.search">

                                    <template v-slot:item="{ item }">
                                        <tr>
                                            <td>{{ item.class }}</td>
                                            <td>{{ item.method }}</td>
                                                    <td>
                                                <v-dialog scrollable scroll-strategy="block" width="96%" height="96%">
                                                    <!-- width="95%" height="95%" scrollable scroll-strategy="block"-->
                                                    <template v-slot:activator="{ props }">
                                                        <v-btn v-if="item.status === 'FAILED'" v-bind="props"
                                                            variant="text" color="red"> {{ item.status }}</v-btn>
                                                        <v-btn v-else-if="item.status === 'SKIPPED'" v-bind="props"
                                                            variant="text" color="grey"> {{ item.status }}</v-btn>
                                                        <v-btn v-else="item.status === 'PASSED'" v-bind="props"
                                                            variant="text" color="blue"> {{ item.status }}</v-btn>
                                                    </template>
                                                    <template v-slot:default="{ isActive }">
                                                        <v-card>
                                                            <v-card-actions class="bg-light-blue-lighten-4">
                                                                <h3>Details</h3>
                                                                <v-spacer></v-spacer>
                                                                <v-btn text="X" @click="isActive.value = false"></v-btn>
                                                            </v-card-actions>

                                                            <v-card-item class="bg-light-blue-lighten-4" style="padding-left: 4px; padding-top: 0px;">
                                                                <v-tabs align-tabs="start" v-model="testDetailTab">
                                                                    <v-tab value="records" v-if="item.records && item.records.length > 0">Records</v-tab>
                                                                    <v-tab value="logs">Logs</v-tab>
                                                                    <v-tab value="error"
                                                                        v-if="item.error.length > 0">Error</v-tab>
                                                                    <v-tab value="screenshot"
                                                                        v-if="item.screenshot.length > 0">Screenshot</v-tab>
                                                                </v-tabs>
                                                            </v-card-item>

                                                            <v-card-text style="padding: 6px;">
                                                                <v-window v-model="testDetailTab">
                                                                    <v-window-item value="records">
                                                                        <v-stepper>
                                                                            <template v-slot:default="{ prev, next }">
                                                                                <v-stepper-header>
                                                                                    <template
                                                                                        v-for="record, index in item.records">
                                                                                        <v-stepper-item
                                                                                            :value="index + 1"
                                                                                            :title="record.type"
                                                                                            :subtitle="record.datetime"></v-stepper-item>
                                                                                        <v-divider
                                                                                            v-if="index < item.records.length - 1"></v-divider>
                                                                                    </template>
                                                                                </v-stepper-header>

                                                                                <v-divider thickness="8"
                                                                                    class="border-opacity-0"></v-divider>
                                                                                <v-stepper-actions @click:next="next"
                                                                                    @click:prev="prev"></v-stepper-actions>

                                                                                <v-stepper-window>
                                                                                    <v-stepper-window-item
                                                                                        v-for="record, index in item.records"
                                                                                        :value="index + 1">

                                                                                        <v-card>
                                                                                            <v-card title="Description"
                                                                                                v-show="record.description"
                                                                                                :text="record.description"></v-card>
                                                                                            <v-card title="Duration"
                                                                                                v-show="record.duration"
                                                                                                :text="record.duration"></v-card>
                                                                                            <v-card title="Round"
                                                                                                v-show="record.round"
                                                                                                :text="record.round"></v-card>
                                                                                            <v-card
                                                                                                title="Class and Method"
                                                                                                v-show="record.classMethod"
                                                                                                :text="record.classMethod"></v-card>
                                                                                            <v-card title="Result"
                                                                                                v-show="record.result"
                                                                                                :text="record.result"></v-card>
                                                                                            <v-card title="Expected"
                                                                                                v-show="record.expected"
                                                                                                :text="record.expected"></v-card>
                                                                                            <v-card title="Actual"
                                                                                                v-show="record.actual"
                                                                                                :text="record.actual"></v-card>
                                                                                            <v-card
                                                                                                title="Supplementary"
                                                                                                v-show="record.supplementary"
                                                                                                :text="record.supplementary"></v-card>
                                                                                            <v-card
                                                                                                title="Extra Information"
                                                                                                v-show="record.extraInfo"
                                                                                                :text="record.extraInfo"></v-card>
                                                                                            <v-card
                                                                                                title="Captured Location"
                                                                                                v-show="record.capturedLocation"
                                                                                                :text="record.capturedLocation"></v-card>
                                                                                            <v-card title="Screenshot"
                                                                                                v-show="record.screenshotBase64">
                                                                                                <v-img cover
                                                                                                    :src="record.screenshotBase64"></v-img>
                                                                                            </v-card>
                                                                                        </v-card>
                                                                                    </v-stepper-window-item>
